    <nav>
      <Link to="/">Home</Link>
      {" | "}
      <Link to="/godzilla-list">Godzilla</Link>
      {" | "}
      <Link to="/mechagodzilla-list">Mechagodzilla</Link>
      {" | "}
      <Link to="/ghidorah-list">Ghidorah</Link>
    </nav>
  );
};

export default Nav;
